    _.log("scarico: "+i)
    if(index == 0)
        return false;

    var scheda_tecnica_uri = _.filter(assets[i].downloads, function(elem){
        return elem.title == "scheda_tecnica"
    });

    if( _.is(scheda_tecnica_uri[0]) ){
        var id = S(assets[i].id).replaceAll(".","_").s;
        const file = fs.createWriteStream("./assets/scheda_tecnica_"+id+".pdf");
        const request = http.get(scheda_tecnica_uri[0].uri, function(response) {
            response.pipe(file);
        });
    }


